import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the email input field to load
    await page.waitForSelector('#email');

    // Input email and password
    await page.fill('#email', 'test@example.com');
    await page.fill('#password', 'password123');

    // Click the login button
    await page.click('button.login-btn');

    // Wait for navigation to complete after login
    await page.waitForLoadState('networkidle');

    // Take screenshot after login attempt
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_login.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_login.png'));

    // Check for success message or error message
    const successMessage = await page.$('text=Login successful!');
    const errorMessage = await page.$('text=Please fill in both email and password.');

    let extractedData = {};
    if (successMessage) {
      extractedData.message = 'Login successful!';
    } else if (errorMessage) {
      extractedData.message = 'Login failed.';
    } else {
      extractedData.message = 'Unknown result.';
    }

    return {
      success: true,
      action: "Attempted to log in and checked for success or error messages.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
